function App() {
  return (
    <Router>
    <div className="App">
     <Header />

     <Routes>
      <Route path="/" element={<HomePage />} />
      <Route path="/lunch" element={<LunchPage />} />
     </Routes>
    </div>
    </Router>
  );
}

export default App;
